         "Sharing Personal Information" : "[českém~Sharing Personal Information]",
         "We may share your personal information internally and externally with suppliers, advisors, or Business Partners for IBM\u2019s legitimate business purposes, and only on a need-to-know basis. This section describes how we share information and how we facilitate that sharing." : "[českém~We may share your personal information internally and externally with suppliers, advisors, or Business Partners for IBM’s legitimate business purposes, and only on a need-to-know basis. This section describes how we share information and how we facilitate that sharing.]",
