         "    Our business model includes cooperation with independent Business Partners for marketing, selling, and the provision of IBM products and services. Where appropriate, we share business contact information with selected Business Partners." : "[českém~    Our business model includes cooperation with independent Business Partners for marketing, selling, and the provision of IBM products and services. Where appropriate, we share business contact information with selected Business Partners.]",
         "    We may share personal information with professional advisors, including lawyers, auditors, and insurance companies to receive their services." : "[českém~    We may share personal information with professional advisors, including lawyers, auditors, and insurance companies to receive their services.]",
