         "While the EU-US and Swiss-US Privacy Shield Framework can no longer be relied upon for the transfer of Personal Information, we continue to comply with all EU-US Privacy Shield Framework and Swiss-US Privacy Shield Framework obligations. For more information, see IBM Privacy Shield Privacy Policy (https:\/\/www.ibm.com\/privacy\/privacy-shield) and US Department of Commerce. (https:\/\/www.privacyshield.gov\/welcome)" : "[českém~While the EU-US and Swiss-US Privacy Shield Framework can no longer be relied upon for the transfer of Personal Information, we continue to comply with all EU-US Privacy Shield Framework and Swiss-US Privacy Shield Framework obligations. For more information, see IBM Privacy Shield Privacy Policy (https://www.ibm.com/privacy/privacy-shield) and US Department of Commerce. (https://www.privacyshield.gov/welcome)]",
         "Controller and Representative Information \u2013 If your mobile app connects to an IBM Cloud or Online Service" : "[českém~Controller and Representative Information – If your mobile app connects to an IBM Cloud or Online Service]",
